import React from 'react'
const fakeData = [
    {
        id: 1,
        description: 'Product A',
        pricr: 130
    },
    {
        id: 2,
        description: 'Product B',
        pricr: 300
    },
    {
        id: 3,
        description: 'Product C',
        pricr: 600
    }
]

function Competition() {
    return (
        <div>
            {fakeData.map(prod => (
                <div>
                    {prod.description}
                </div>
            ))}
        </div>
    )
}

export default Competition;
